import React from "react";
import "./Transactions.css";

function Transactions() {
  return (
    <div className="Transactions">

      <div className="Cards"></div>
      <button className="Btn-Movimientos" alt="boton que selecciona ver el resumen de los movimientos en tu targeta">Movimientos</button>
      <button className="Btn-Operaciones" alt="boton que selecciona ver opciones de operaciones">Operaciones</button>
      <div className="Operations" >
      <button className="Btn-Telefono" alt="boton que selecciona la opcion de pagar telefono">Telefono</button>
      <button className="Btn-Agua" alt="boton que selecciona la opcion de pagar Agua">Agua</button>
      <button className="Btn-Luz" alt="boton que selecciona la opcion de pagar Luz">Luz</button>
      <button className="Btn-Internet" alt="boton que selecciona la opcion de pagar Internet">Internet</button>
      <button className="Btn-Targetas" alt="boton que selecciona la opcion de pagar Targetas">Pago Targetas</button>
      <button className="Btn-Otros" alt="boton que selecciona la opcion de pagar Otras cuentas">Otros</button>
      </div>

    </div>
  );
}

export default Transactions;
